    const formated = date.format("dddd, D MMM YYYY")
    console.log(formated);
    const Header = (
        <div>
            <div>
                <div>
                    <h2>Ташкент</h2>
                    <p></p>
                </div>
                <div>
                    <div>
                        <i></i>
                        <input type="search" name="" id="" />
                    </div>
                </div>
            </div>
        </div>
    )
    return (
        <div>
            <div className='home-page'>

            </div>
        </div>
    )
}
